import React from "react";
import MatrixComponent from "./graph_info/MatrixComponent.jsx";
import Output from "./graph_info/Output.jsx";

export default function Tools({
  vertexCount,
  rowHeaders,
  data,
  setRowHeaders,
  setVertexCount,
  setData,
  start,
  end,
  startOnChange,
  endOnChange
}) {
  const [deleted, setDeleted] = useState(
    Array.from({ length: vertexCount }, () => "")
  );
  const [columnHeaders, setColumnHeaders] = useState(
    Array.from({ length: vertexCount }, () => "")
  );

  return (
    <div className="right">
      <MatrixComponent
        rowHeaders={rowHeaders}
        data={data}
        setRowHeaders={setRowHeaders}
        setData={setData}
        vertexCount={vertexCount}
        setVertexCount={setVertexCount}
      />
      <hr className="hr" />
      <Output
        rowHeaders={rowHeaders}
        data={data}
        start={start}
        end={end}
        startOnChange={startOnChange}
        endOnChange={endOnChange}
      />
    </div>
  );
}
